import React from 'react'
import { Route, Routes } from 'react-router-dom'
import Home from './pages/Home'
import Cart from './pages/Cart'



const App = () => {
  return (

    <div>
      <div> <Navbar/> </div>
      <Routes>
        <Route path='/' element= { <Home/> } >  </Route>
        <Route path='/cart' element= { <Cart/> } >  </Route>

      </Routes>
    </div>

  );
};

export default App;
